const QuestionTypes = {
  Math: {
    index: 0,
    id: "Math",
    name: "Math",
  },
  ShortAnswer: {
    index: 1,
    id: "Short-Answer",
    name: "Short Answer",
  },
  MultiChoice: {
    index: 2,
    id: "Multi-Choice",
    name: "Multiple Choice",
  },
  GridMultiChoice: {
    index: 3,
    id: "Grid-Multi-Choice",
    name: "Choice Matrix",
  },
};
export default QuestionTypes;
